package ru.pavlenov.bio.chapter.rosalind.sequence;

import org.biojava3.core.sequence.DNASequence;
import org.biojava3.core.sequence.ProteinSequence;
import org.biojava3.core.sequence.transcription.TranscriptionEngine;
import ru.pavlenov.bio.utils.Dump;

/**
 * Created by laser13 on 28.06.14.
 *
 * Protein Translation
 * http://rosalind.info/problems/ptra/
 *
 *
 * Given: A DNA string s of length at most 10 kbp, and a protein string translated by s.
 *
 * Return: The index of the genetic code variant that was used for translation. (If multiple solutions exist, you may return any one.)
 *
 * http://www.bioinformatics.org/JaMBW/2/3/TranslationTables.html
 * http://biojava.org/wiki/BioJava:CookBook:Core:Overview
 *
 */
public class Ptra {

    public static void start() {

        String dnaStr = "";
        String aaStr = "";

        DNASequence dna = new DNASequence(dnaStr);

        for (int i = 0; i <= 23; i++) {

            TranscriptionEngine.Builder b = new TranscriptionEngine.Builder();
            TranscriptionEngine engine = b.table(i).build();
            ProteinSequence protein = dna.getRNASequence().getProteinSequence(engine);

            if (protein.toString().equals(aaStr)) {
                Dump.println(protein);
                Dump.println(i);
                break;
            }


        }
        Dump.println(aaStr);

    }

}
